import Button from '@mui/material/Button';
import axios from 'axios';

export default function Test (){
    const [text, setText] = useState("");
    function getText(){
        axios.get("http://localhost:5000/", { crossdomain: true }).then(
            () => setText("Something wooo")
        )
    }
    return(
        <div>
            <Button>
            Test
            </Button>
            <h1>{text}</h1>
        </div>
    )
};
